css:
@-moz-document url-prefix('https://www.tumblr.com/') {

A.new_post_label > I {height: 90px}
.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
}
.new_post .new_post_label/*_icon*/ > I {
	background: url('data:image/png;base64,') no-repeat !important;
	z-index: -1;
}
/* Big planets, please: */
/* planets are 59w x 60h; icons 64h x 513w (nominal 75w)*/
/* x1.2 --> 72x72 icons in 76.8h x 615.6w strip */
.new_post .new_post_label/*_icon*/ > I {
	background-size: auto 77px !important;
	transition: background-position .6s linear !important;
}

.new_post_label:nth-of-type(1) > I {background-position: /*-moz-calc(1.2 * -4px) -moz-calc(1.2 * 12px)*/-4.8px 14.4px !important}
.new_post_label:nth-of-type(2) > I {background-position: /*-moz-calc(1.2 * -76px) -moz-calc(1.2 * 12px)*/-91.2px 14.4px !important}
.new_post_label:nth-of-type(3) > I {background-position: /*-moz-calc(1.2 * -150px) -moz-calc(1.2 * 12px)*/-180px 14.4px !important}
.new_post_label:nth-of-type(4) > I {background-position: /*-moz-calc(1.2 * -224px) -moz-calc(1.2 * 12px)*/-268.8px 14.4px !important}
.new_post_label:nth-of-type(5) > I {background-position: /*-moz-calc(1.2 * -296px) -moz-calc(1.2 * 12px)*/-355.2px 14.4px !important}
.new_post_label:nth-of-type(6) > I {background-position: /*-moz-calc(1.2 * -370px) -moz-calc(1.2 * 12px)*/-444px 14.4px !important}
.new_post_label:nth-of-type(7) > I {background-position: /*-moz-calc(1.2 * -447px) -moz-calc(1.2 * 12px)*/-536.4px 14.4px !important}

.new_post_label:nth-of-type(1):hover > I {background-position: /*-moz-calc(1.2 * -4px) -moz-calc(1.2 * -2px)*/-4.8px -2.4px !important}
.new_post_label:nth-of-type(2):hover > I {background-position: /*-moz-calc(1.2 * -76px) -moz-calc(1.2 * -2px)*/-91.2px -2.4px !important}
.new_post_label:nth-of-type(3):hover > I {background-position: /*-moz-calc(1.2 * -150px) -moz-calc(1.2 * -2px)*/-180px -2.4px !important}
.new_post_label:nth-of-type(4):hover > I {background-position: /*-moz-calc(1.2 * -224px) -moz-calc(1.2 * -2px)*/-268.8px -2.4px !important}
.new_post_label:nth-of-type(5):hover > I {background-position: /*-moz-calc(1.2 * -296px) -moz-calc(1.2 * -2px)*/-355.2px -2.4px !important}
.new_post_label:nth-of-type(6):hover > I {background-position: /*-moz-calc(1.2 * -370px) -moz-calc(1.2 * -2px)*/-444px -2.4px !important}
.new_post_label:nth-of-type(7):hover > I {background-position: /*-moz-calc(1.2 * -447px) -moz-calc(1.2 * -2px)*/-536.4px -2.4px !important}

.new_post .new_post_label {
	font-size: 14px !important;
	padding: 5px 1px 74px 0 !important;
	font-family: Georgia, Times New Roman, sans-serif !important;
	font-style: italic !important;
	text-transform: lowercase !important;
	color: #222 !important;
	letter-spacing: 1px !important;
}

}
